import React from 'react';
import {connect} from 'react-redux';
import {withRouter} from 'react-router-dom';
import {openPopup, closePopup} from '../store/modal/actions';
import {addNotify} from '../store/notify/actions';
import {
  getUserProjects, 
  createUserProject, 
  deleteUserProject, 
  addUserInProject,
  deleteUserInProject,
  getOtherProjects,
  getProjectById
} from '../store/projects/actions';
import {
  getComponents, 
  createComponent,
  deleteComponent
} from '../store/components/actions';

import {getSnippets, createSnippet, updateSnippet} from '../store/snippets/actions';
import Home from '../components/Home/Home';


function HomeContainer(props) {

  return (
    <Home {...props}/>
  );
}

const mapStateToProps = (state) => {
  return {
    popupIsOpen: state.modal.popupIsOpen,
    myProjects: state.projects.myProjects,
    otherProjects: state.projects.otherProjects,
    currentProject: state.projects.currentProject,
    auth: state.auth,
    components: state.components, 
    snippets: state.snippets
  }
};

const mapDispatchToProps = {
  openPopup,
  closePopup,
  getUserProjects,
  createUserProject,
  addNotify, 
  deleteUserProject,
  addUserInProject,
  deleteUserInProject,
  getOtherProjects,
  getComponents,
  createComponent,
  getProjectById,
  getSnippets,
  createSnippet,
  updateSnippet,
  deleteComponent
};

const HomeContainerWidthRouter = withRouter(HomeContainer);

export default connect(mapStateToProps, mapDispatchToProps)(HomeContainerWidthRouter);
